import React from "react";
import { useEffect } from "react";

function Home(){

    

    useEffect(async()=>{

        let response = await fetch('/api/home')
        let json = await response.json()

        if(response.ok){
            
            if(json.toLink !== ''){
                window.location.href = json.toLink;
            }
        }

    }, [])

    return(
        <>
            <div className="container" id = "">
                <h1>Home</h1>
            </div>
        </>
    );

}

export default Home;
